 es nicht \u00e4ndern . ich k\u00f6nnte dem text h\u00f6chstens ein bisschen gut zureden, dass er auch als platzhalter eine wichtige rolle spielt und durchaus gebraucht wird. k\u00f6nnte mir vorstellen, dass ihm das gut tut. denn das gef\u00fchl gebraucht zu werden tut doch jedem gut, oder? klar, er ist austauschbar. das darf ich ihm nat\u00fcrlich nicht verraten. denn austauschbar zu sein, dass ist schrecklich. austauschbar zu sein bedeutet ja eigentlich, dass nicht man selbst, sondern einfach irgendjemand oder irgendwas an der stelle gebraucht wird. somit w\u00fcrde mein erstes argument, man braucht dich, nicht mehr ziehen, und das zuvor erzeugte gute gef\u00fchl des textes w\u00e4re zunichte gemacht. das will ich nicht. also bitte nix verraten, ja? aber vielleicht merkt er es ja nicht. das w\u00e4re gut, denn wer hat schon lust einen deprimierten blindtext auf seiner seite zu platzieren. was w\u00fcrde denn das f\u00fcr einen eindruck machen. das will ja keiner lesen. somit w\u00e4re er dann ein f\u00fcr alle mal tats\u00e4chlich v\u00f6llig nutzlos. das w\u00e4re sein todesurteil. soweit wollen wir es doch nicht kommen lassen, oder? es sei denn, und das ist m\u00f6glich, er w\u00fcrde wiedergeboren und k\u00e4me als, naja, sagen wir als witz, und ein textleben sp\u00e4ter vielleicht als bildzeitungsartikel auf die textwelt. irgendwann w\u00e4re er vielleicht sogar ein text im lexikon. dann h\u00e4tten wir ihn ja sogar weitergebracht in seiner entwicklung. klingt gar nicht schlecht, oder? trotzdem bin ich der meinung, man sollte ihn nicht bewusst dort hin treiben. er hat ein recht darauf, sich selbst zu entwickeln. und zwar in genau dem tempo, das ihm gef\u00e4llt. und bis es soweit ist, nehme ich ihn eben an, wie er ist. als einfachen blindtext ohne wirklichen inhalt.')","params":[],"duration_str":"29.44ms","memory_str":"0B","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\bbwn_cms\\libraries\\vendor\\joomla\\database\\src\\Mysqli\\MysqliDriver.php:776","callstack":[],"